import React from 'react';
import Link from 'next/link';
import Router from 'next/router';
import styles from '../styles/HomePage.module.css';

import {getUserInformation} from '../services/api';

function HomePage() {

    let loggedIn = () => { 
        if (process.browser) {
            var accessToken = localStorage.getItem('token');
            if (accessToken) return true;
            if (!accessToken) return false;
        }
    }

    let logOut = () => {
        localStorage.removeItem('token');
        Router.push('/')
        return;
    }

    let fetchUserData = async () => {
        const resp = await getUserInformation();
        if (resp) {
            if (resp.status === 200) {
                console.log(resp.data[0]); }
        }
    };

    return (
            <div className={styles.main}>
            {loggedIn() ? 
            <>
                <h4>M E T A _ IDentity Services Platform</h4>
                You are logged in. This will be your dashboard.
                <button onClick={() => fetchUserData()}>View user data.</button>
                <button onClick={() => logOut()}>
                    Logout
                </button>
            </> : <>
                    <span>M E T A _ I D</span>
                    <h2>Decentralized Travel Identity</h2>
                    <div>Protect your identity and payment information when traveling abroad. Powered by Marqeta and DiD.</div>
                    <Link href='/register'>
                        <button className={styles.rgBtn}>
                            Get Started
                        </button>
                    </Link>
                    <Link href='/login'>
                        <a>
                            Already a user? Login.
                        </a>
                    </Link>
            </>
            }
            </div>
    );
}

export default HomePage;
